*/

import React,{ useState,useEffect } from "react";

// @mui material components
import Card from "@mui/material/Card";
import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import axios from "axios"

// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React examples
import DataTable from "examples/Tables/DataTable";

// Data
import data from "layouts/dashboard/components/Projects/data";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import { Modal, Paper, TableCell, TableHead } from "@mui/material";
import TableRow from "@mui/material/TableRow";
import TableBody from "@mui/material/TableBody";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 900,
  bgcolor: 'background.paper',
  border: '2px solid #000',
  boxShadow: 24,
  p: 4,
};
function Projects() {
  const { columns, rows } = data();
  const [menu, setMenu] = useState([]);

  const [prdetails,setPrdetails] = useState([])
  const [commitdetails,setCommitDetails] = useState([])

  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);




  useEffect(() => {
    axios
      .get(`https://mockbin.org/bin/684bac23-9896-4941-b572-3c4be72fa26f/view`)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;
        const content = data.content;
        console.log("content", content);
        const text = content.text;
        console.log("text", text);
        const datajson = JSON.parse(text);
        console.log("datajson",datajson)
        setMenu(datajson)
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  const openMenu = ({ currentTarget }) => setMenu(currentTarget);
  const closeMenu = () => setMenu(null);

  const selectoption =(e)=>{
    console.log(e)

const selectedoption = e.target.value;
    console.log("selected",selectedoption)
    axios
      .get(`https://mockbin.org/bin/45e0e661-f74b-49d4-89de-e2b97b9227de?service_id=` + selectedoption)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;

        console.log("data", data);

        setPrdetails(data)
      })
      .catch(function (error) {
        console.log(error);
      });
  }

  const [unittest,setunitDetails] = useState([])
  const [ec2coverage,setec2coverage] = useState([])
  const [integration_coverage,setintegration_coverage] = useState([])
  const checkCommitId =(e)=>{
    handleOpen()
    console.log(e)
    const selectedcommitId = e.target.value;
    console.log("selectedcommitId",selectedcommitId)
    axios
      .get(`https://mockbin.org/bin/b5d49ed3-8637-4a13-8044-ef61898f0768?commit_id=` + selectedcommitId)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;

        console.log("data", data);

        setunitDetails(data.unit_test);
        setec2coverage(data.e2e_coverage);
        setintegration_coverage(data.integration_coverage);


      })
      .catch(function (error) {
        console.log(error);
      });
  }


  const renderMenu = (
    <Menu
      id="simple-menu"
      anchorEl={menu}
      anchorOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      transformOrigin={{
        vertical: "top",
        horizontal: "right",
      }}
      open={Boolean(menu)}
      onClose={closeMenu}
    >

      <MenuItem onClick={closeMenu}>Action</MenuItem>
      <MenuItem onClick={closeMenu}>Another action</MenuItem>
      <MenuItem onClick={closeMenu}>Something else</MenuItem>
    </Menu>
  );

  return (
    <Card>
      <Card>

      </Card>


      <MDBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <MDBox>
          <MDTypography variant="h6" gutterBottom>
            Service Details
          </MDTypography>
        </MDBox>
        {/*<Menu*/}
        {/*  id="simple-menu"*/}
        {/*  anchorEl={menu}*/}
        {/*  anchorOrigin={{*/}
        {/*    vertical: "top",*/}
        {/*    horizontal: "left",*/}
        {/*  }}*/}
